// ------------------------------  on form selection  -----------------------------------------------------
// get element by class name
function onGetElementByClassName(className) {
  var elements = document.getElementsByClassName(className);
  return elements[0];
}
// on form selection
function onFormSelection(type) {
  const suggestionDescriptionElement = onGetElementByClassName(
    "form-suggestion-description"
  );
  const createImageElement = onGetElementByClassName("form-create-image");
  const imageVariationElement = onGetElementByClassName("form-image-variation");
  switch (type) {
    case "image-create":
      suggestionDescriptionElement.style.display = "none";
      createImageElement.style.display = "block";
      imageVariationElement.style.display = "none";
      break;
    case "image-variation":
      suggestionDescriptionElement.style.display = "none";
      createImageElement.style.display = "none";
      imageVariationElement.style.display = "block";
      break;
    default:
      suggestionDescriptionElement.style.display = "block";
      createImageElement.style.display = "none";
      imageVariationElement.style.display = "none";
      break;
  }
}

