function onSuggestionDescriptionApi(apiData, question) {
  debugger;
  onLoader(true);
  const url = apiData.baseUrl + apiData.suggestionDescriptionPath;
  postData(url, {
    prompt_template: "Create a description for '{question}'",
    question: question,
  })
    .then((data) => {
      console.log(data); // JSON data parsed by `data.json()` call
      onSuggestionDescriptionOutput(data);
    })
    .catch((error) => {
      console.log(error);
      onSuggestionDescriptionOutput("Server Error");
    })
    .finally(() => {
      onLoader(false);
      onResetSuggestionDescription();
    });
}

