// image variations
function onImageVariationInput(data) {
  lastElement += 1;
  const { imageData, dimension, count } = data;
  let renderImage = null;
  const reader = new FileReader();
  reader.onload = function (event) {
    renderImage = event.target.result;
    const payload = {
      id: lastElement,
      user: {
        id: 1,
        profile: {
          image: "./assets/ai/images/profile.png",
        },
      },
      data: {
        type: "string",
        result: `
          <div class="image-input">
            <img src="${renderImage}"  />
          </div>
          <div class="image-dimension-info">
              <span>Dimension: ${dimension}</span>
              <span>Count: ${count}</span>
          </div>
          `,
      },
      pagination: { startIndex: 1, lastIndex: 3, isActive: false },
      actions: { copy: {}, like: false, dislike: false },
    };
    onCreateOutputElement(payload);
    onCreateImageApi(
        apiData,
        dimension,
        count,
        imageData
    );
  };
  reader.readAsDataURL(imageData);
}

function onImageVariationOutput(list) {
  const imageList = onCreateImageList(list);
  lastElement += 1;
  const payload = {
    id: lastElement,
    user: {
      id: 2,
      profile: {
        image: "./assets/ai/logo/logo.svg",
      },
    },
    data: {
      type: "string",
      result: `
        <div class="image-list-container">
            ${imageList}
        </div>
        `,
    },
    pagination: { startIndex: 1, lastIndex: 3, isActive: false },
    actions: { copy: {}, like: false, dislike: false },
  };
  onCreateOutputElement(payload);
}

function onImageVariationApi(apiData, dimension, no_of_images, imageBlob) {
  onLoader(true);
  const url = apiData.baseUrl + apiData.imageVariationPath;
  url += "?" + "dimension=" + dimension + "&no_of_images=" + no_of_images;
  // form data
  var uploadFormData = new FormData();
  uploadFormData.append("uploaded_file", imageBlob, imageBlob.name);
  postData(url, uploadFormData)
    .then((data) => {
      console.log(data); // JSON data parsed by `data.json()` call
    })
    .catch((error) => {
      console.log(error);
    })
    .finally(() => {
      onImageVariationOutput([
        {
          b64_json:
            "",
        },
        {
          b64_json:
            "",
        },
        {
          b64_json:
            "",
        },
        {
          b64_json:
            "",
        },
      ]);
      onLoader(false);
      onResetImageVariation();
    });
}

function onGenerate(event, type) {
  event.preventDefault();
  switch (type) {
    case "create-image":
      onCreateImageInput({
        text: questionCreateImage,
        dimension: dimensionCreateImage,
        count: no_of_imagesCreateImage,
      });
      onCreateImageApi(
        apiData,
        questionCreateImage,
        dimensionCreateImage,
        no_of_imagesCreateImage
      );
      break;
    case "image-variation":
      onImageVariationInput({
        imageData: blobImageVariation,
        dimension: dimensionCreateImage,
        count: no_of_imagesCreateImage,
      });
      break;
    default:
      onSuggestionDescriptionInput(questionSuggestionDescription);
      onSuggestionDescriptionApi(apiData, questionSuggestionDescription);
      break;
  }
}
